import axios from 'axios'

export const addToOrder = async (order, product) => {
    let newOrder = {...order};
    newOrder.goods.push(product);
    let response = await axios.post('http://192.168.88.205:8000/newOrder', newOrder.goods)
    return {
        type: 'ADD_TO_ORDER',
        payload: response.data
    }
}
